script: |
  super -f tsv -I q5635.sql | sort > q5635.out

vector: true

inputs:
  - name: q5635.sql
    data: |
      SELECT ( 32 ) FROM tab1 WHERE col2 * - 43 / - 18 * + COALESCE ( - 77, + + col2 + + COALESCE ( NULLIF ( - col1, + 55 * 31 + CAST ( + col2 AS INTEGER ) ), col1 ) ) * + col2 <> ( 31 ) GROUP BY col1;
  - name: tab1

outputs:
  - name: q5635.out
    data: |
      32
      32
      32
